    false,nt"url": null,nt"notes": "This data set is a georeferenced version
    of an original black and white aerial photograph downloaded from Earth Explorer
    (USGS; www.earthexplorer.usgs.gov). The original photo was georeferenced against
    the 2009 NAIP image within ArcMap 10.1. Six to eight points were used in the georeferencing
    process. This data set provides a look back in time prior to refuge establishment
    in 1960. It allows a look at landscape features prior to refuge impoundments and
    other developments. It also provides an important look at the location of the Green
    River channel from which other images in subsequent years were compared to interpret
    river dynamics and movement. Pixel resolution of this image is 5 meters. This image
    should be used for resource level interpretation only.",nt"license_title":
